import './App.css';
import { BrowserRouter, Route, Routes } from "react-router-dom";
import components from "./components/Header"
import Home from './pages/Home';


function App() {
  return (
    <div className="root-wrap">
      <BrowserRouter>
        <components.Nav/>
        <Routes>
          <Route index element={<Main />} />
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
